import './App.css';
import './Components/Css/Home.css'
import './Components/Css/Apply.css'
import './Components/Css/Nav.css'
import Nav from './Components/Nav';

function App() {
  return (
   <div className='App'>
   <Nav/>
   <Routes>
    <Route path="/" exact element = { <Home/>}> </Route>
   </Routes>
   </div>
  );
}

export default App;
